import React from "react";
import { View, Text } from "react-native";
import { CustomScreenFC } from "../models/ScreenFC";

const SettingScreen: CustomScreenFC<"Setting"> = () => {
  return (
    <View>
      <Text>SettingScreen</Text>
    </View>
  );
};

export default SettingScreen;
